import TodoList from "./Components/TodoList";
import Login from "./Components/Login";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Login />,
  },
]);

function App() {
  return (
    <Box>
      <TodoForm />
      <TodoList />
    </Box>
  );
}

export default App;
